INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (4, 1, 3001, 1, 11300101, 10, 8, 7, 1, "フフ、全問正解よ！\nちゃんと勉強してるみたいで\n感心だわ♪", 3.18, 10, "vo_minigame_1012_result_1000");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (10, 1, 3001, 1, 11300102, 10, 7, 8, 1, "すごいじゃない…全問正解よ！\nま、当然といや当然よね～\nだってあたしが\n教えてやってんだから♪", 3.33, 10, "vo_minigame_1012_result_1001");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (10, 1, 3001, 1, 11300103, 10, 1, 8, 1, "全問正解！　パチパチパチ～♪\nこの難易度はもう完璧じゃない？\n次はもっと難しい問題に挑戦よ！\nあんたならできるって！", 5.41, 10, "vo_minigame_1012_result_1002");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (10, 1, 3001, 2, 11300104, 10, 8, 5, 1, "へえ…難しい問題を選んだのに\n全問正解できてるじゃない！！\nちょっとあんたすごすぎだわ…！\nパーフェクトよパーフェクト！", 8.11, 10, "vo_minigame_1012_result_1003");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 1, 3001, 2, 11300105, 10, 5, 10, 1, "まる…まる…全部まる！\n難しい問題なのに全問正解よ…！\n驚いた…あんたいつの間に、\nこんなに勉強してたのよ！", 1.31, 10, "vo_minigame_1012_result_1004");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 1, 3001, 2, 11300106, 10, 8, 9, 1, "ここまで完璧に正解されちゃうと\nちょっと悔しいわね…！\nけど素直に褒めてやるわ！\nえらい、えらい、えら～い！", 4.93, 10, "vo_minigame_1012_result_1005");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (4, 1, 3001, 3, 11300107, 10, 8, 5, 1, "すごい…あんたパーフェクトよ！\nこのままいけば次の試験、\n学年一位も夢じゃないかもね！\n楽しみだわ～♪", 2.99, 10, "vo_minigame_1012_result_1006");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (4, 1, 3001, 3, 11300108, 10, 7, 8, 1, "満点よ！　フフ、もうあんたに\n教えることはなにもないわ…！\n逆にあたしがあんたに教わりたい\nくらいよ！　…ね、先生♪", 8.37, 10, "vo_minigame_1012_result_1007");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (8, 1, 3001, 3, 11300109, 10, 5, 7, 1, "全・問・正・解！\n超難問揃いなのにすごいわね…！\nもしかしてだけど、\nあんたって天才！？", 5.32, 10, "vo_minigame_1012_result_1008");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (4, 1, 3001, 1, 11300110, 7, 1, 7, 1, "お、かなりいい点数ね～！\nあたしも教えがいがあるわ♪\nさ、まだまだ勉強するわよ！", 4.77, 9, "vo_minigame_1012_result_1009");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (4, 1, 3001, 1, 11300111, 7, 7, 8, 1, "うん、いい感じで点取れてるわ！\nこの調子で次は、\n満点を見せてほしいわね！", 2.97, 9, "vo_minigame_1012_result_1010");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 1, 3001, 1, 11300112, 7, 1, 5, 1, "あ～惜しい！\nもうちょっとで満点じゃない！\n次はパーフェクトいけるわ！\n頑張りましょ！", 3.47, 9, "vo_minigame_1012_result_1011");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (4, 1, 3001, 2, 11300113, 7, 7, 8, 1, "すごい、かなりできてるわよ！\n難しい問題なのにやるじゃない！\nあとは目指せ、満点ね！", 5.32, 9, "vo_minigame_1012_result_1012");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (10, 1, 3001, 2, 11300114, 7, 7, 8, 1, "うん、かなりいい感じよ！\nあんたには赤点の心配なんて\nまーったくなさそうね♪\nでも勉強はやめさせないけど！", 6.49, 9, "vo_minigame_1012_result_1013");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 1, 3001, 2, 11300115, 7, 1, 5, 1, "あーあとちょっとで\n全問正解だったのに！\n難しい問題だけどあんたなら\n次は満点狙えるわ！", 3.56, 9, "vo_minigame_1012_result_1014");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (10, 1, 3001, 3, 11300116, 7, 1, 8, 1, "うん、ほとんど正解よ！\nこんな難しい問題なのに、\nすごいじゃない！\nやっぱりあんた只者じゃないわ！", 5.67, 9, "vo_minigame_1012_result_1015");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (10, 1, 3001, 3, 11300117, 7, 1, 7, 1, "着実に成長してるって感じね？\nあんたならこの難問でも、\nいつか満点取れちゃうかも…！", 2.85, 9, "vo_minigame_1012_result_1016");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 1, 3001, 3, 11300118, 7, 1, 5, 1, "うわー惜しいわね！\nもうちょっとで満点よ？\nま、あたしでも悩む難問だから、\nこの点数は胸を張っていいわ！", 3.88, 9, "vo_minigame_1012_result_1017");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 1, 3001, 1, 11300119, 4, 1, 3, 1, "正解率は半分くらいか～\n悪くはないんだけど、あんたなら\nこんなもんじゃないでしょ？", 4.12, 6, "vo_minigame_1012_result_1018");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 1, 3001, 1, 11300120, 4, 1, 9, 1, "んーはっきり言っちゃうと\n中途半端な点数ね…\nまあいいわ！こっからガンガン\n点数上げていくわよ！", 4.34, 6, "vo_minigame_1012_result_1019");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 1, 3001, 1, 11300121, 4, 1, 3, 1, "う～ん、正直物足りない点数ね！\nあんたには期待してんだから、\nもっと頑張んなさい！", 3.15, 6, "vo_minigame_1012_result_1020");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 1, 3001, 2, 11300122, 4, 1, 9, 1, "半分くらいの正解率か\n難しい問題だから仕方ないわね…\nでもあんたはもっとできる！\nだってあたしがついてんのよ！", 5.3, 6, "vo_minigame_1012_result_1021");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 1, 3001, 2, 11300123, 4, 1, 8, 1, "うん、そこそこできんじゃない！\n頑張って勉強して\nさらに上を目指しましょ！", 2.55, 6, "vo_minigame_1012_result_1022");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 1, 3001, 2, 11300124, 4, 7, 1, 1, "難問なのにこの正解率は\nよくやってる方よね！\nでもこんなところで\n満足してんじゃないわよ！？", 4.19, 6, "vo_minigame_1012_result_1023");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 1, 3001, 3, 11300125, 4, 1, 7, 1, "難問なのに半分くらい正解\nできてんじゃない♪\nこの調子でもっと学力\n上げていきましょ！", 3.43, 6, "vo_minigame_1012_result_1024");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 1, 3001, 3, 11300126, 4, 1, 1, 1, "よし、平均点ってとこね！\nちゃんと勉強してるみたいで\n安心したわ～♪", 0.0, 6, "vo_minigame_1012_result_1025");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 1, 3001, 3, 11300127, 4, 7, 8, 1, "難問揃いでこの正解率は\n大したもんよ！\nま、もっといい点取りたいんなら\n勉強、付き合ったげるわ！", 3.72, 6, "vo_minigame_1012_result_1026");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (1, 1, 3001, 1, 11300128, 1, 2, 3, 1, "なるほど…\nこれは教えがいがあるわね\nビシバシ鍛えてやるから\n覚悟しなさい！", 3.5, 3, "vo_minigame_1012_result_1027");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (1, 1, 3001, 1, 11300129, 1, 2, 4, 1, "ちょっとあんた、\n全然できてないじゃない！\n…まさかこれが本気だなんて\n言わないわよね～？", 3.25, 3, "vo_minigame_1012_result_1028");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 1, 3001, 1, 11300130, 1, 2, 3, 1, "うーん……適当に答えても\nこれくらい正解できるわよ？\nちょっと本腰入れて\n教えないとね……！", 4.62, 3, "vo_minigame_1012_result_1029");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 1, 3001, 2, 11300131, 1, 1, 9, 1, "…ま、まあこの問題は\nあんたには難しすぎたのかもね\nちょっとずつでいいから、\nレベルアップしていきましょ！", 4.5, 3, "vo_minigame_1012_result_1030");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (9, 1, 3001, 2, 11300132, 1, 3, 3, 1, "んー結構ミスっちゃってるわね…\nこのまま続けるのもいいけど、\n簡単な問題からやり直すのも\nありかもよ～？", 0.01, 3, "vo_minigame_1012_result_1031");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (9, 1, 3001, 2, 11300133, 1, 9, 9, 1, "あらら、あんたにはちょっと\n難しすぎたかしら…？\nもう一回やり直しましょうか！", 0.01, 3, "vo_minigame_1012_result_1032");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (6, 1, 3001, 3, 11300134, 1, 3, 3, 1, "うーん、残念な結果ね…\n超難問だから仕方ないけど\n無理せず簡単な問題から挑戦\nしてもいいかもよ？", 0.01, 3, "vo_minigame_1012_result_1033");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 1, 3001, 3, 11300135, 1, 9, 3, 1, "正解率はかなり悪いわね…\nまあ難しい問題だもんね…！\nそのチャレンジ精神は買うわ！", 2.97, 3, "vo_minigame_1012_result_1034");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 1, 3001, 3, 11300136, 1, 1, 3, 1, "なんとか０点は免れたわね…\n難問揃いだけど、\nもっと頑張っていきましょ！", 3.1, 3, "vo_minigame_1012_result_1035");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (1, 1, 3001, 1, 11300137, 0, 2, 6, 1, "…あんたさ、０点なんて\n逆に取るの難しいわよ！？\nまさか狙ったわけじゃ\nないでしょーね～！？", 4.31, 0, "vo_minigame_1012_result_1036");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (1, 1, 3001, 1, 11300138, 0, 2, 2, 1, "０点って…\nあんたふざけてんの！？\nちゃんとやらないなら\n電撃魔法くらわせるわよ！？", 0.1, 0, "vo_minigame_1012_result_1037");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (9, 1, 3001, 1, 11300139, 0, 3, 9, 1, "もしかしたらあんたは\n勉強向いてないのかもね…\n…勉強だけがすべてじゃないわ\n違うとこで頑張りましょ！", 4.23, 0, "vo_minigame_1012_result_1038");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 1, 3001, 2, 11300140, 0, 2, 3, 1, "怒んないから正直に言って？\n…ふざけて答えたでしょ？\nほら、正直に\n言・い・な・さ・い？", 4.38, 0, "vo_minigame_1012_result_1039");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 1, 3001, 2, 11300141, 0, 2, 8, 1, "あんたの点数は～～…\n…はい！　０てーん！！\n…って、ふざけんなーー！！！", 3.58, 0, "vo_minigame_1012_result_1040");
