INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (7, 1, 3001, 3, 12300107, 20, 4, 5, 2, "すごいすごいとは思ってたけど、\nあんた勉強も完璧なの…？\nそりゃみんなあんたに惚れ…\nや、な、なんでもない！！", 6.85, -1, "vo_minigame_1012_result_1051");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 1, 3001, 3, 12300108, 20, 9, 5, 2, "この問題、あたしでも悩む\n超難問なのに…\nふふっ、もう褒めるしかないわ！\n大変よくできました！", 3.79, -1, "vo_minigame_1012_result_1052");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (7, 1, 3001, 3, 12300109, 20, 4, 4, 2, "別に顔赤くなんてなってない！\n頭がいい人が好きとか…\nかっこいいとか…\n…思ってないからね！", 0.01, -1, "vo_minigame_1012_result_1053");
