INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (10, 1, 3001, 1, 12300117, 15, 8, 8, 2, "うん、バッチリいい感じよ！\nちゃんと勉強してるみたいで\n関心関心♪", 0.01, 19, "vo_minigame_1012_result_1057");
