INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 1, 3001, 1, 12300146, 5, 7, 1, 2, "ふ～ん、まあまあの出来だわ\n悪くはないんだけど…あんたには\nもっともっと期待してるわ～", 4.24, 9, "vo_minigame_1012_result_1078");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 1, 3001, 1, 12300147, 5, 1, 7, 2, "うん、頑張ったけど…\n正直もっと正解できるかもね～？\nこんなのあんたには通過点！\nさらに良い点目指してみない？", 4.74, 9, "vo_minigame_1012_result_1079");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 1, 3001, 1, 12300148, 5, 1, 1, 2, "まあまあな点数だけど、\n自分的に手ごたえはどう？\nダメだって思ってんなら、\nまだまだ伸びる余地ありね！", 0.0, 9, "vo_minigame_1012_result_1080");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 1, 3001, 2, 12300149, 5, 1, 8, 2, "うん、中々の出来ね！\nでもあんたはもっといい点\n取れるはずよ！\nもっと頑張りましょうか！", 2.21, 9, "vo_minigame_1012_result_1081");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 1, 3001, 2, 12300150, 5, 1, 3, 2, "ん～はっきり言って微妙ね！\nま、難しい問題だし、\n勉強すれば\n点数は上がっていくと思うわ！", 2.46, 9, "vo_minigame_1012_result_1082");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 1, 3001, 2, 12300151, 5, 1, 3, 2, "ん～…\n10点には届かなかったか～\n次は10点越え目指して\n頑張ってみない？", 2.94, 9, "vo_minigame_1012_result_1083");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 1, 3001, 3, 12300152, 5, 1, 7, 2, "はいお疲れ～\n点数的にはまあまあってとこね！\nま、超難問だし頑張ったわよ", 4.19, 9, "vo_minigame_1012_result_1084");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 1, 3001, 3, 12300153, 5, 1, 1, 2, "うん、かなり難しい問題なのに\n最後までやり遂げたわね\n次はもっといい点目指してみる？", 0.0, 9, "vo_minigame_1012_result_1085");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 1, 3001, 3, 12300154, 5, 1, 3, 2, "ちょっとミスが多かったかもね～\nでも間違えた所は復習して\n次は正解するわよー！", 2.63, 9, "vo_minigame_1012_result_1086");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 1, 3001, 1, 12300155, 1, 1, 3, 2, "あら…あんまり良くない点数ね～\nどうしたの、調子でも悪かった？\n次はもっと頑張りましょうか", 5.53, 4, "vo_minigame_1012_result_1087");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (9, 1, 3001, 1, 12300156, 1, 3, 3, 2, "ん～…正解数は\n物足りないわね～\nもうちょっと勉強の時間\n増やしちゃおっか？", 0.01, 4, "vo_minigame_1012_result_1088");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (3, 1, 3001, 1, 12300157, 1, 1, 3, 2, "ん～…あんたならもうちょと\nいい点取れんでしょ～？\nもっと頑張んなさいよ\n期待してやってんだからさ！", 4.15, 4, "vo_minigame_1012_result_1089");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (9, 1, 3001, 2, 12300158, 1, 9, 9, 2, "ん～今のあんたには、\nこの問題は難しかったかしら…\n難易度下げてチャレンジするのも\nありかもね～？", 0.01, 4, "vo_minigame_1012_result_1090");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 1, 3001, 2, 12300159, 1, 1, 3, 2, "あんまり出来は良くないわね～\n難しい問題だししょうがないけど\n次はもっと頑張ってほしいわ！", 5.37, 4, "vo_minigame_1012_result_1091");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 1, 3001, 2, 12300160, 1, 1, 3, 2, "なるほど…\nちょっと苦手な問題が多かった？\nもう一度チャレンジ\nしてみましょうか～", 1.44, 4, "vo_minigame_1012_result_1092");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 1, 3001, 3, 12300161, 1, 3, 3, 2, "んん～…問題が難しすぎた？\n無理に難しい問題続けるより、\n難易度下げた方が\n勉強の効率良いかもよ～？", 0.0, 4, "vo_minigame_1012_result_1093");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (3, 1, 3001, 3, 12300162, 1, 9, 3, 2, "…あんまり点数取れなかったわね\nこれはあたしにも難しい問題だし\nそう落ち込まなくても大丈夫！\n次頑張りましょ！", 2.91, 4, "vo_minigame_1012_result_1094");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 1, 3001, 3, 12300163, 1, 1, 5, 2, "ごめん、ちょっと難しすぎた？\nもう一度チャレンジするも良し、\n難易度を下げるも良し、\nあんたがやる気なら付き合うわ！", 2.61, 4, "vo_minigame_1012_result_1095");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (1, 1, 3001, 1, 12300164, 0, 2, 4, 2, "ちょっとあんた…\nやる気ないわよね～！？\n次こんな点数取ったら\n怒るわよ！", 3.63, 0, "vo_minigame_1012_result_1096");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (1, 1, 3001, 1, 12300165, 0, 2, 6, 2, "はあ…自分で何点取ったか\n分かってるわよね～…？\n０点よ０点！　舐めてんの！？", 4.16, 0, "vo_minigame_1012_result_1097");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (6, 1, 3001, 1, 12300166, 0, 3, 3, 2, "うう～頭痛い…\nあんたのせいよ！\nなに０点って！\nはあ、このままじゃ赤点よ～…", 0.01, 0, "vo_minigame_1012_result_1098");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 1, 3001, 2, 12300167, 0, 2, 6, 2, "ねえ、あんた本気でやったの？\nまさか適当にやるわけないわよね\n…分かった、\nもう一回チャレンジするのよ！", 5.75, 0, "vo_minigame_1012_result_1099");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (1, 1, 3001, 2, 12300168, 0, 2, 4, 2, "あ…あんた、０点よ０点…！\nあたしの教え方が悪かった…？\n…燃えてきたわ！\n絶対あんたの学力上げてやる！", 5.64, 0, "vo_minigame_1012_result_1100");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (8, 1, 3001, 2, 12300169, 0, 4, 8, 2, "ちょっと待って採点ミスかも…\n…いや合ってるわね。はい０点\n…って０点！？\nふざけんなーー！", 5.73, 0, "vo_minigame_1012_result_1101");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (1, 1, 3001, 3, 12300170, 0, 3, 5, 2, "あらら…０点よ\nま、難しい問題だしね…\n…つっても０点は無いわ！\n一問くらい正解しなさいよ！", 5.32, 0, "vo_minigame_1012_result_1102");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (9, 1, 3001, 3, 12300171, 0, 9, 3, 2, "残念だけど０点よ\nま、まあ前向きにとらえるなら、\n今が底よ！　どん底！\nあとは上がってくだけね！", 2.37, 0, "vo_minigame_1012_result_1103");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (3, 1, 3001, 3, 12300172, 0, 1, 9, 2, "…かなり出来が悪いわね\n一旦休憩しましょうか？\nリフレッシュして頭切り替えて\nもう一度頑張りましょう！", 4.25, 0, "vo_minigame_1012_result_1104");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 1, 1001, 0, 13100101, 0, 7, 7, 3, "さ、勉強を始めるわよ", 0.0, 0, "vo_minigame_1012_gamestart_100");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 1, 1001, 0, 13100102, 0, 1, 1, 3, "よし、勉強の成果を見てやるわ！", 0.0, 0, "vo_minigame_1012_gamestart_101");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 1, 1001, 0, 13100103, 0, 7, 1, 3, "じゃあ試験するわよ。はい教科書閉じて！", 1.82, 0, "vo_minigame_1012_gamestart_102");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (4, 1, 1002, 0, 13100201, 3, 8, 8, 3, "やる気マンマンじゃない！", 0.01, -1, "vo_minigame_1012_gamestart_103");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 1, 1002, 0, 13100202, 3, 1, 1, 3, "よし、じゃあもう一回やるわよ！", 0.0, -1, "vo_minigame_1012_gamestart_104");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 1, 1003, 0, 13100301, 1, 0, 0, 3, "普通の難易度よ！", 0.0, 1, "vo_minigame_1012_gamestart_105");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 1, 1003, 0, 13100302, 1, 7, 7, 3, "まずは基本からね！", 0.0, 1, "vo_minigame_1012_gamestart_106");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 1, 1003, 0, 13100303, 2, 10, 10, 3, "難しい問題に挑戦するのね！", 0.0, 2, "vo_minigame_1012_gamestart_107");
