INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 1, 1003, 0, 13100305, 3, 5, 5, 3, "あたしでも手こずる難問揃いよ…！", 0.0, 3, "vo_minigame_1012_gamestart_109");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 1, 1003, 0, 13100306, 3, 2, 2, 3, "激ムズだけど頑張んなさい！", 0.0, 3, "vo_minigame_1012_gamestart_110");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 1, 1004, 0, 13100401, 0, 7, 7, 3, "鉄は熱いうちに打て、\n…ってね♪", 0.0, 0, "vo_minigame_1012_gamestart_111");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 1, 1004, 0, 13100402, 0, 1, 1, 3, "よし、もっぺんやるわよ！", 0.0, 0, "vo_minigame_1012_gamestart_112");
