INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 1, 1103, 0, 13110307, 8, 2, 2, 3, "最後まで集中よ！", 0.0, 10, "vo_minigame_1012_start_112");
