INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 2, 3001, 1, 21300101, 10, 0, 6, 1, "すご、全部〇じゃん…！\nこの調子で教えてくれたら\nうちも頭よくなりそー！", 3.32, 10, "vo_minigame_1012_result_2000");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (3, 2, 3001, 1, 21300102, 10, 2, 6, 1, "え、〇しかなかった…？\n満点ってほんとにあるんだ…\nヒデサイマジすごい…！", 6.5, 10, "vo_minigame_1012_result_2001");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (5, 2, 3001, 1, 21300103, 10, 6, 3, 1, "満点じゃん！　やりー！\nもしかしてヒデサイには\n簡単過ぎた感じ？", 3.1, 10, "vo_minigame_1012_result_2002");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (11, 2, 3001, 2, 21300104, 10, 2, 3, 1, "ビシッと決まったね！\nヒデサイ、ベンキョー\n教えてくれてありがとー♪", 2.06, 10, "vo_minigame_1012_result_2003");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 2, 3001, 2, 21300105, 10, 7, 3, 1, "ムズい問題もぜーんぶ正解！\n激アツじゃん！\nヒデサイ、頭よすぎ～", 4.45, 10, "vo_minigame_1012_result_2004");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (11, 2, 3001, 2, 21300106, 10, 2, 2, 1, "きゃはっ、満点じゃん！\n一緒にベンキョーしてる\nうちまでいい気分！", 0.01, 10, "vo_minigame_1012_result_2005");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (11, 2, 3001, 3, 21300107, 10, 3, 2, 1, "ヒデサイ、満点パーフェクト！\nこれで、もーサイツヨだね！\nそれっ、ハイタッチ～！", 6.64, 10, "vo_minigame_1012_result_2006");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 2, 3001, 3, 21300108, 10, 6, 6, 1, "カンペキ過ぎて\nまぶしぃんですけど！\n〇しかないってどゆこと！？", 0.0, 10, "vo_minigame_1012_result_2007");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 2, 3001, 3, 21300109, 10, 7, 6, 1, "おにムズでも満点じゃん…！\nヒデサイセンセーマジすごい！\nこれからも頼りにしてるよ～", 5.76, 10, "vo_minigame_1012_result_2008");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 2, 3001, 1, 21300110, 7, 6, 6, 1, "ヒデサイ、もしかして\nよゆーな感じ？\n正解しまくりじゃん！", 0.0, 9, "vo_minigame_1012_result_2009");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 2, 3001, 1, 21300111, 7, 7, 2, 1, "〇いっぱいで、わろ～\nてかヒデサイ教えるのうまっ！\nめちゃわかりやすかったよ♪", 2.59, 9, "vo_minigame_1012_result_2010");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (11, 2, 3001, 1, 21300112, 7, 3, 2, 1, "これだけ〇あったら、\nめちゃ気持ちいいね♪\n次は満点取っちゃおー！", 4.09, 9, "vo_minigame_1012_result_2011");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 2, 3001, 2, 21300113, 7, 3, 2, 1, "満点まで、もーすぐじゃん！\nさっすがヒデサイ！\nバイブス上がってきた～", 2.47, 9, "vo_minigame_1012_result_2012");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (11, 2, 3001, 2, 21300114, 7, 3, 3, 1, "きゃはっ、めちゃ解けてる～\nもー次は満点っしょ！\nテンアゲしてきたね♪", 0.01, 9, "vo_minigame_1012_result_2013");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 2, 3001, 2, 21300115, 7, 2, 2, 1, "ヒデサイのおかげで\nうちもちょっちベンキョー\nわかってきたかも！", 0.0, 9, "vo_minigame_1012_result_2014");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 2, 3001, 3, 21300116, 7, 2, 6, 1, "おにムズ問題も\n〇ばっかじゃん…！\nヒデサイ、マジ心強い！", 3.45, 9, "vo_minigame_1012_result_2015");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 2, 3001, 3, 21300117, 7, 3, 3, 1, "ヒデサイセンセーに\n追いつけ追い越せ！\nうちもがんばる～！", 0.0, 9, "vo_minigame_1012_result_2016");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 2, 3001, 3, 21300118, 7, 3, 2, 1, "おにムズ問題も\nあとちょいで満点じゃん！\nもーここまできたら\nやるしかないっしょ！", 4.0, 9, "vo_minigame_1012_result_2017");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 2, 3001, 1, 21300119, 4, 0, 6, 1, "お！　あと半分だし\nうちも、もうちっと\nがんばってみるね！", 0.92, 6, "vo_minigame_1012_result_2018");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 2, 3001, 1, 21300120, 4, 3, 0, 1, "まだイミフな問題あるけど\n悪くないよね？\nバイブス上がってきたし\n次もっとイケんじゃない？", 4.36, 6, "vo_minigame_1012_result_2019");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 2, 3001, 1, 21300121, 4, 2, 6, 1, "だいたい半分ぐらい？\nじゃあ、こっからだね！\n集中、集中！", 2.35, 6, "vo_minigame_1012_result_2020");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 2, 3001, 2, 21300122, 4, 2, 0, 1, "これで半分ぐらい？\nよしっ、とりま赤点回避！\nやりー！", 2.13, 6, "vo_minigame_1012_result_2021");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 2, 3001, 2, 21300123, 4, 2, 0, 1, "あともう半分だね！\nフレッフレッ、ヒデサイ！\nうちもがんばる～！", 2.38, 6, "vo_minigame_1012_result_2022");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 2, 3001, 2, 21300124, 4, 0, 4, 1, "う～ん、やっぱムズいね\nでも、半分ぐらい〇だし\nイケそーな気するね！", 3.5, 6, "vo_minigame_1012_result_2023");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 2, 3001, 3, 21300125, 4, 6, 0, 1, "だいたい半分正解？\nとゆーことは\nあと半分で満点じゃん！", 2.25, 6, "vo_minigame_1012_result_2024");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 2, 3001, 3, 21300126, 4, 6, 3, 1, "やるじゃんヒデサイ！\nえ？　もっと上目指すの？\nじゃあうちもがんばる！", 2.14, 6, "vo_minigame_1012_result_2025");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 2, 3001, 3, 21300127, 4, 2, 6, 1, "おにムズだったのに\n半分解けてる…！？\nヒデサイいい感じ！", 3.75, 6, "vo_minigame_1012_result_2026");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (5, 2, 3001, 1, 21300128, 1, 10, 4, 1, "おにムズだったね～\n…え？　これって簡単なの？\nえへへ、うそだ～？", 2.53, 3, "vo_minigame_1012_result_2027");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (9, 2, 3001, 1, 21300129, 1, 4, 4, 1, "…ねーねー、ヒデサイ\nうちに合わせて\n悪い点取らなくていいんだよ？", 0.01, 3, "vo_minigame_1012_result_2028");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 2, 3001, 1, 21300130, 1, 3, 0, 1, "ウォーミングアップは\nこんなところで…\nヒデサイ、次は\n本気出しちゃおうよ！", 2.93, 3, "vo_minigame_1012_result_2029");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (4, 2, 3001, 2, 21300131, 1, 3, 0, 1, "あ、ヒデサイ\nうちと点数おそろじゃん！\n一緒に赤点取っちゃおっか～♪", 4.26, 3, "vo_minigame_1012_result_2030");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 2, 3001, 2, 21300132, 1, 10, 10, 1, "えーっと…\nもっかい教えてくれたら\n次はもうちょい\nイケる気するよっ！", 0.0, 3, "vo_minigame_1012_result_2031");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (5, 2, 3001, 2, 21300133, 1, 0, 9, 1, "うちもさっぱりだった～\nどこ間違えたんだろ…？\nもっかいベンキョーしてみる？", 4.98, 3, "vo_minigame_1012_result_2032");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (9, 2, 3001, 3, 21300134, 1, 4, 4, 1, "おにムズ過ぎてマジさっぱり…\nどーしよ…\nヒデサイ、助けて～", 0.01, 3, "vo_minigame_1012_result_2033");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (6, 2, 3001, 3, 21300135, 1, 4, 4, 1, "赤点って感じ？\nう～ん…せっかくだし\nうちと一緒にがんばろ！", 0.01, 3, "vo_minigame_1012_result_2034");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (11, 2, 3001, 3, 21300136, 1, 10, 4, 1, "やっぱムズいね…\nでも０点じゃないし\nオーライっしょ！", 2.51, 3, "vo_minigame_1012_result_2035");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 2, 3001, 1, 21300137, 0, 6, 0, 1, "よし、結果は…\nって０ってマ！？\nヒデサイ、どーしちゃったの？", 2.54, 0, "vo_minigame_1012_result_2036");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (5, 2, 3001, 1, 21300138, 0, 10, 2, 1, "ヒデサイ\nわざと０点取ったっしょ？\n違うの？　ほんとに～？", 4.08, 0, "vo_minigame_1012_result_2037");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 2, 3001, 1, 21300139, 0, 4, 6, 1, "ヒデサイ、０点だね…\nうちが代わりに\nベンキョー教えてあげよっか…？", 3.41, 0, "vo_minigame_1012_result_2038");
