INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 2, 3001, 2, 22300150, 5, 6, 10, 2, "問題ムズいし、この点数は\nありよりのありっしょ？\nえ、もっとできた感じ？", 4.68, 9, "vo_minigame_1012_result_2082");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 2, 3001, 2, 22300151, 5, 9, 9, 2, "どこ間違ったんだろ？\nうちさっぱりだった…\nやっぱムズいだけあるね", 0.0, 9, "vo_minigame_1012_result_2083");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 2, 3001, 3, 22300152, 5, 3, 0, 2, "激ムズだけど\nやることは一緒だよね？\nうちもヒデサイについてくから\nコツコツがんばろ！", 3.55, 9, "vo_minigame_1012_result_2084");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 2, 3001, 3, 22300153, 5, 6, 4, 2, "やっぱおにムズだね…\nそだ、迷ったら\nヒント使うのも\nありよりのあり？", 2.51, 9, "vo_minigame_1012_result_2085");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 2, 3001, 3, 22300154, 5, 5, 9, 2, "やっぱテストって\nなんとなくじゃ無理？\n覚えるしかないの？\nじゃあがんばるしかないね…", 6.15, 9, "vo_minigame_1012_result_2086");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (6, 2, 3001, 1, 22300155, 1, 9, 4, 2, "できたと思ったけど\nそーじゃなかった系？\nテストってマジきびしー…", 4.12, 4, "vo_minigame_1012_result_2087");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (6, 2, 3001, 1, 22300156, 1, 4, 4, 2, "うーん…さっぱり！\nでも簡単な問題なんだよね…？\nもっかいやってみる？", 0.01, 4, "vo_minigame_1012_result_2088");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 2, 3001, 1, 22300157, 1, 3, 0, 2, "うちらまだまだ\nベンキョーちうだし…\nこれからだよねっ？\nね、ヒデサイ！", 5.28, 4, "vo_minigame_1012_result_2089");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 2, 3001, 2, 22300158, 1, 3, 0, 2, "ちょっとずつ覚えれば\nおーけーっしょ！\nうちと一緒に\nベンキョーだね！", 2.89, 4, "vo_minigame_1012_result_2090");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 2, 3001, 2, 22300159, 1, 7, 0, 2, "うちベンキョー苦手でも\nヒデサイとベンキョー\nするのは好き！　だから\nもっかい教えてくれる？", 5.45, 4, "vo_minigame_1012_result_2091");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (3, 2, 3001, 2, 22300160, 1, 10, 4, 2, "覚えても、すぐ忘れるんだけど\nどしたらいい？\nあ、そーゆうとき\nフクシューする感じ？", 4.29, 4, "vo_minigame_1012_result_2092");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (6, 2, 3001, 3, 22300161, 1, 8, 4, 2, "ムズ過ぎ！\n頭パンクするかと思った…！\nヒデサイ、うちの頭\nふぅふぅして～", 4.64, 4, "vo_minigame_1012_result_2093");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 2, 3001, 3, 22300162, 1, 5, 9, 2, "おにムズ過ぎてテンサゲ～\nでもヒデサイがんばってるし\nうちもがんばる！", 3.14, 4, "vo_minigame_1012_result_2094");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 2, 3001, 3, 22300163, 1, 4, 7, 2, "ヒデサイと同じ点数で\nちょっち安心したかも\n一緒にがんばろーね！\n置いてっちゃやだよ？", 6.59, 4, "vo_minigame_1012_result_2095");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 2, 3001, 1, 22300164, 0, 3, 3, 2, "…まあ、これより下はないし\n次は大逆転\n点数爆上がりっしょ！", 0.0, 0, "vo_minigame_1012_result_2096");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (5, 2, 3001, 1, 22300165, 0, 10, 9, 2, "０点じゃん…\nそだ、次はえんぴつ転がして\n選ぶ作戦やってみる？", 2.2, 0, "vo_minigame_1012_result_2097");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (6, 2, 3001, 1, 22300166, 0, 4, 4, 2, "考えるの無理な時あるよね…\nヒデサイもそーゆう\n感じだったの？", 0.01, 0, "vo_minigame_1012_result_2098");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (3, 2, 3001, 2, 22300167, 0, 2, 6, 2, "え、ヒデサイも０点？\nじゃあうちと一緒じゃん♪\nまあ焦んないで\nベンキョーしてこーよ！", 2.8, 0, "vo_minigame_1012_result_2099");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (6, 2, 3001, 2, 22300168, 0, 4, 9, 2, "むむむ～…０点…！\n覚えてもすぐ忘れちゃうし\nベンキョーってマジ大変", 3.22, 0, "vo_minigame_1012_result_2100");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (11, 2, 3001, 2, 22300169, 0, 0, 4, 2, "０点だね…\nでも、へーきへーき\nリベンジしたら、結果オーライ！", 2.1, 0, "vo_minigame_1012_result_2101");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (3, 2, 3001, 3, 22300170, 0, 2, 0, 2, "おやつ休憩して\nリベンジしよっ！\n甘いの食べたら、イケるっしょ！", 2.74, 0, "vo_minigame_1012_result_2102");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (9, 2, 3001, 3, 22300171, 0, 9, 6, 2, "ヒデサイでも\nおにムズな感じ？\nじゃあ、このテスト\n誰も解けなくない？", 3.0, 0, "vo_minigame_1012_result_2103");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (0, 2, 3001, 3, 22300172, 0, 2, 10, 2, "…あれ？\n０が〇に見えてきた！\nきゃはっ、ちょっち\nやる気出てきたかも！", 4.37, 0, "vo_minigame_1012_result_2104");
INSERT INTO `v1_331f87fd07f5bfc09d6b75dd2eefc5c30acaf99d85522b9a86ab1f76bb50e34e` VALUES (10, 2, 1001, 0, 23100101, 0, 0, 0, 3, "よーし、がんばるぞー", 0.01, 0, "vo_minigame_1012_gamestart_200");
